    "TildeEqual", "TildeFullEqual", "TildeTilde", "Times", "Trademark", "Transpose", "UAcute", "UDoubleAcute", "UDoubleDot", "UGrave", "UHat", "UnderBrace", "UnderBracket", "UnderParenthesis", "Union", "UnionPlus", "UpArrow", "UpArrowBar", "UpArrowDownArrow", "UpDownArrow", "UpEquilibrium",
    "UpperLeftArrow", "UpperRightArrow", "UpPointer", "Upsilon", "UpTee", "UpTeeArrow", "Uranus", "URing", "Vee", "Venus", "VerticalBar", "VerticalEllipsis", "VerticalLine", "VerticalSeparator", "VerticalTilde", "VeryThinSpace", "WarningSign", "WatchIcon", "Wedge", "WeierstrassP", "WhiteBishop",
    "WhiteKing", "WhiteKnight", "WhitePawn", "WhiteQueen", "WhiteRook", "Wolf", "WolframLanguageLogo", "WolframLanguageLogoCircle", "Xi", "Xnor", "Xor", "YAcute", "YDoubleDot", "Yen", "Zeta", "ZHacek"
